/**
 * @param {number[][]} grid
 * @return {number}
 */
var shortestPathBinaryMatrix = function(grid) {
  let len = []
  for (const row of grid) {
    len.push(row.map(() => 100 * 100 + 1))
  }

  //const toKey = (a) => a.join(' ')

  var path = [ [ 0, 0 ] ]
  len[0][0] = 1

  const visit = (x, y) => {
    const l = len[x][y] + 1

    if (grid[x][y] > 0) {
      return
    }

    for (let i = x - 1; i < x + 2; i++) {
      for (let j = y - 1; j < y + 2; j++) {
        if (i < 0 || j < 0 || i >= grid.length || j >= grid[i].length || grid[i][j] > 0) {
          continue
        }

        //const key = toKey([ i, j ])
        if (len[i][j] > l) {
          len[i][j] = l
          //grid[i][j] = 1

          path.push([ i, j ])
        }
      }
    }
  }

  while (path.length > 0) {
    var next = path.shift()
    visit(...next)
  }

  let res = len[grid.length - 1][grid[0].length - 1]

  return res > 100 * 100 ? -1 : res
}

